ZygorGuidesViewer.Professions.SpellToItem = {}
ZygorGuidesViewer.Professions.ItemToSpell = {}

for _,skillRecipes in pairs(ZygorGuidesViewer.Professions.AllRecipes) do
	for _,recipe in pairs(skillRecipes) do
		if not recipe["faction"] or recipe["faction"]==UnitFactionGroup("player") then
			ZygorGuidesViewer.Professions.SpellToItem[recipe.spell] = recipe.productid
			ZygorGuidesViewer.Professions.ItemToSpell[recipe.productid] = recipe.spell
		end
	end
end
